import React from 'react'
import ChaptersList from './Chapters_list'

const Chapters=(props)=>{
    return(
        <ul>
            {props.Subject.map((subject)=>{
                return(
                    <li key={subject}>
                        <h2>Select Chapters from {subject}</h2>
                        <form action="/action_page.php">
                            <ul>
                            {props.Chapters.map((chapter)=>{
                               return <ChaptersList chapter={chapter}/>
                            })}
                            </ul>
                            
                        <input 
                            style={{"marginLeft":"45%",
                                "text":"white",
                                "fontSize":"30px",
                                "textAlign":"center",
                                "backgroundColor":"blue",
                                "padding":"5px"}} 
                            type="submit" 
                            value="Start the Quizz"/>
                        <br/><br/>
                        
                        </form>
                    </li>
                )
            })}
  
      </ul>
    );
}

export default Chapters;
